a = list(map(int, input().split()))

def calc(a, pos, pos_count):
	if pos == len(a):
		return True
	if a[pos] == 0:
		return False

	for i in range(pos + 1, len(a)):
		if a[i] == 0:
			continue
		if calc(a, i, pos_count):
			return True

	return False

if calc(a, 0, 0):
